export function MainMenu() {
    return(
        <nav className="App-header">
            <ul>
                <li className="links"><a href='#'>Blog</a></li>
                <li className="links"><a href='#'>Sobre</a></li>
                <li className="links"><a href='#'>Descrição</a></li>
            </ul>
        </nav>
    );
};
